function Item(props){
    const {item}=props
    return(
        <tr>
            <td>{item.name}</td>
            <td>{item.symbol}</td>
            <td>{'$ '+(item.current_price).toLocaleString('en-US')}</td>
            {
                item.price_change_percentage_24h
                ?
                    <td>{Number(item.price_change_percentage_24h).toFixed(2).toString()+" %"}</td>
                :
                    <td>{Number(item.price_change_percentage_1month).toFixed(2).toString()+" %"}</td>
            }
           {item.market_cap&&<td>{'$ '+(item.market_cap).toLocaleString('en-US')}</td>}
        </tr>
    )
}
export default Item
